import React from 'react';

export default function Person({ personsState }) {
  return (
    <div>
      <p onClick={personsState.switchNameHandler}>
        I am a {personsState.name} and I am {personsState.age} years old
      </p>
      <p>{personsState.children}</p>
    </div>
  );
}
